import { IItem } from "../models/GroceryItem";

interface RemoveProps {
  item: IItem;
}

export default function Remove({ item, onClick }: RemoveProps) {
  return (
    <button
      type="button"
      className="btn btn-dark btn-sm"
      onClick={() => onClick(item)}
    >
      Remove item
    </button>
  );
}
